@voguemagazine Vogue US June/July 
by @colin_dodgson ❤️

I can’t help but get emotional over this one, my first solo american vogue cover. I feel like I’m holding little Kaia and telling her that she will have a voice one day, reminding her not to grow up too fast. the last four years have given me so much to be grateful for, but they have also taught me so many lessons - some harder to learn than others. there have been many moments were I felt like my body and face were being used to interpret who I am. finally feeling free of that and continuing to learn as I grow, I want to thank everyone at vogue and @frynaomifry from the bottom of my heart for asking me questions I have always wanted to be asked, and for being incredible listeners. & a special thanks to @colin_dodgson for capturing me at the beach I grew up on in a way that only someone from just a few beaches up the coast could. link in bio for the whole story.
